import { BrowserRouter, Router, Switch } from "react-router-dom";
import Login from "./component/Login";

function App() {
  return (
    <BrowserRouter>
      <Switch>
        <Router path="/">
          <Login/>
        </Router>
      </Switch>
    </BrowserRouter>
  );
}

export default App;
